INSERT INTO `wiki_wiki` (`id`, `title`, `doc`, `tags`) VALUES
(1, '参考规范', '<h2>\r\n	<span style="white-space:nowrap;">一、文件编码</span> \r\n</h2>\r\n<blockquote style="margin:0 0 0 40px;border:none;padding:0px;">\r\n	<p>\r\n		<span style="white-space:nowrap;">保存文件的编码、文件内容编码、数据库编码必须保持一致，推荐使用 <span style="background-color:#FFFFFF;color:#E53333;">utf－8</span>&nbsp; &nbsp;&nbsp;</span> \r\n	</p>\r\n	<p>\r\n		<span style="white-space:nowrap;"><br />\r\n</span> \r\n	</p>\r\n</blockquote>\r\n<hr />\r\n<h2>\r\n	二、文件与目录命名\r\n</h2>\r\n<blockquote style="margin:0 0 0 40px;border:none;padding:0px;">\r\n	<ul>\r\n		<li>\r\n			2.1&nbsp;一律小写，必须是英文单词或产品名称的拼音，多个单词使用下划线(_)连接，只能出现英文字母、数组和连接符，严禁出现中文。\r\n		</li>\r\n		<li>\r\n			2.2&nbsp;出现版本号时，需要采用字母 v 作为前缀，小版本号使用.隔开。如 global_v8.js、global_v8.1.js\r\n		</li>\r\n		<li>\r\n			2.3&nbsp;压缩后的文件统一采用_min结尾，如 base_min.js、base_v1.2_min.js\r\n		</li>\r\n	</ul>\r\n	<p>\r\n		该命名规范适用于 html、css、javascript、swf、php、xml、png、gif、jpg、ico等由前端负责维护的文件类型和相关目录\r\n	</p>\r\n</blockquote>\r\n<hr />\r\n<h2>\r\n	三、id 和 class 命名规范\r\n</h2>\r\n<blockquote style="margin:0 0 0 40px;border:none;padding:0px;">\r\n	<ul>\r\n		<li>\r\n			3.1&nbsp;id 和 class 的命名总规则为：内容优先，表现为辅。首先根据内容来命名，比如 man_nav，如果根据内容找不到合适的命名，可以再结合表现来定，如 skin_blue、present_tab、col_man。\r\n		</li>\r\n		<li>\r\n			3.2&nbsp;id 和 class 一律小写，多个单词使用下划线（_）连接。\r\n		</li>\r\n		<li>\r\n			3.3&nbsp;id 和 class 只允许出现 字母、数组和连接符，尽量使用英文单词，确实找不到合适的单词时，可以考虑使用产品的中文拼音。严禁出现中文。\r\n		</li>\r\n		<li>\r\n			3.4&nbsp;命名长度适中，不要太简略，也不要太详细，在不影响语义的情况下，可以适当的采取英文缩写，但禁止乱造缩写。\r\n		</li>\r\n		<li>\r\n			3.5&nbsp;在 javascript 中用作 hook 的 id 或 class，一律采用 J_ 开头。\r\n		</li>\r\n	</ul>\r\n</blockquote>\r\n<hr />\r\n<h2>\r\n	四、css编码规范\r\n</h2>\r\n<blockquote style="margin:0 0 0 40px;border:none;padding:0px;">\r\n	<p>\r\n		4.1 统一采用换行书写，t统一缩进一个tab。即：\r\n	</p>\r\n	<p>\r\n		&nbsp;&nbsp;&nbsp;&nbsp;<img src="https://a248.e.akamai.net/camo.github.com/b5438a32a009a24c24a14c0cfee2720574ea3022/687474703a2f2f696d67332e70682e3132362e6e65742f3233615435304171597874716178416e313041774a413d3d2f363539373438303938343030353130383336332e6a7067" alt="" /> \r\n	</p>\r\n	<p>\r\n		4.2 选择器的使用\r\n	</p>\r\n</blockquote>\r\n<blockquote style="margin:0 0 0 40px;border:none;padding:0px;">\r\n	<blockquote style="margin:0 0 0 40px;border:none;padding:0px;">\r\n		<p>\r\n			4.2.1&nbsp;禁止元素选择器和 id 选择器混用，id 选择器前禁止出现其他选择器；如：ul#nav、＃wrapper ＃header\r\n		</p>\r\n		<p>\r\n			4.2.2&nbsp;慎用元素选择器和类选择器混搭，如：ul.nav、ul.list\r\n		</p>\r\n		<p>\r\n			4.2.3&nbsp;选择器层级不要嵌套过深，不宜超过四级，否则，应考虑优化。\r\n		</p>\r\n		<p>\r\n			4.2.4&nbsp;尽量使用类选择器代替标签选择器\r\n		</p>\r\n		<p>\r\n			4.2.5&nbsp;多选择器编写遵循以下格式：\r\n		</p>\r\n		<p>\r\n			&nbsp;&nbsp;&nbsp;&nbsp;<img src="https://a248.e.akamai.net/camo.github.com/5f54a6c0763c98197bff6fa8816f527f2ff3856d/687474703a2f2f696d67322e70682e3132362e6e65742f48644c596c466f6f337959516b3451626c6a757864513d3d2f323634373237323135353938313535313333322e6a7067" alt="" /> \r\n		</p>\r\n	</blockquote>\r\n4.3&nbsp;属性简写：为了提高可读性，尽量采用简写形势，但并非所有，如只需要设置 margin－top，其他3个属性都采用默认，则不适合使用缩写 margin：10px 0 0 0；而应该直接使用 margin－top 进行设置。建议 2 个或以下属性时采用单独设置，否则采用简写。\r\n	<p>\r\n		4.4&nbsp;单位：属性值为 0 的情况，省略单位，0 为前缀时，也可以进行省略。\r\n	</p>\r\n	<p>\r\n		4.5&nbsp;颜色值：尽可能的使用 3 个字符的 16 进制颜值，A-F 统一使用大写字母。\r\n	</p>\r\n	<p>\r\n		4.6&nbsp;hack：应尽量避免使用 hack，多思考，寻求其他解决办法，迫不得已的情况下，hack 部分的代码放在每条规则的最后,并在其后注明所针对的浏览器。如：\r\n	</p>\r\n	<p>\r\n		&nbsp;&nbsp;&nbsp;&nbsp;<img src="https://a248.e.akamai.net/camo.github.com/15f614ad1b46245f114c2c59a2f43cba6fe1ed49/687474703a2f2f696d67362e70682e3132362e6e65742f515f7a55527766582d746849374a5231682d446a37413d3d2f313535323035333032313630303338303939362e6a7067" alt="" /> \r\n	</p>\r\n	<p>\r\n		4.7&nbsp;为成模块的 css 添加注释，注释规范见注释小节。\r\n	</p>\r\n</blockquote>\r\n<p>\r\n	<hr />\r\n</p>\r\n<h2>\r\n	五、HTML 编码规范：\r\n</h2>\r\n<p>\r\n	<blockquote style="margin:0 0 0 40px;border:none;padding:0px;">\r\n		<p>\r\n			5.1 统一使用 html5 的 doctype 声明，即：&lt;!doctype html&gt;,改代码应始终位于文档的第一行，前面禁止出现任何代码或字符（包括注释和空白符）；统一使用 utf－8编码：。\r\n		</p>\r\n		<p>\r\n			5.2 使用语义化的标签编写 html 文档。元素的标签和属性必须小写，属性值用双引号（"")包裹。\r\n		</p>\r\n		<p>\r\n			5.3 合理使用换行和缩进，增加文档的可读性，不必要的空格须去除。\r\n		</p>\r\n		<p>\r\n			5.4 遵循（X）HTML Strict 嵌套规则，正确区分自动闭合和非自动闭合元素。\r\n		</p>\r\n		<p>\r\n			5.5 避免直接在页面中编写样式和脚本。尽量将它们提取到外部文件当中。\r\n		</p>\r\n	</blockquote>\r\n	<hr />\r\n</p>\r\n<h2>\r\n	六、Javascript编码规范：\r\n</h2>\r\n<p>\r\n	<blockquote style="margin:0 0 0 40px;border:none;padding:0px;">\r\n		<p>\r\n			6.1 必须使用 var 来声明变量\r\n		</p>\r\n		<p>\r\n			6.2 尽量不要使用全局变量\r\n		</p>\r\n		<p>\r\n			6.3 不要省略最后的分号\r\n		</p>\r\n		<p>\r\n			6.4 不要在块内声明函数\r\n		</p>\r\n		<p>\r\n			6.5 标准特性优于非标准特性（如果类库有提供，优先使用类库中的函数）\r\n		</p>\r\n		<p>\r\n			6.6 不要封装基本类型\r\n		</p>\r\n	</blockquote>\r\n	<hr />\r\n</p>\r\n<h2>\r\n	七、注释规范：\r\n</h2>\r\n<p>\r\n	<blockquote style="margin:0 0 0 40px;border:none;padding:0px;">\r\n		<p>\r\n			7.1 css：针对每个模块，标明 模块的名称、基础类名、更新时间。格式如下：\r\n		</p>\r\n		<p>\r\n			<img src="https://a248.e.akamai.net/camo.github.com/6b9aaac13921fb5461c0781e83a46114413006fa/687474703a2f2f696d67322e70682e3132362e6e65742f6478692d6f6d34767051484d62324e7a69426a576c413d3d2f363539373137353331393737333739323632322e6a7067" alt="" />\r\n		</p>\r\n		<p>\r\n			7.2 html：对每个模块标明修改时间（在模块的标题处）：&lt;!-- time : 2012-09-21 11:24 --&gt;,其他需要注释的内容，若注释内容较长，采用块级注释。\r\n		</p>\r\n	</blockquote>\r\n</p>', '规范');
